import React from "react";
import LiveHelpIcon from "@material-ui/icons/LiveHelp";

const Faq = () => {
  return (
    <div className="container contact-container" style={{ marginTop: "20px" }}>
      <div className="ctitle">
        <h4>
          <LiveHelpIcon />
          FAQ's
        </h4>
      </div>
      <div className="row">
        <div
          className="col"
          style={{
            marginLeft: "25px",
            borderLeft: "2px solid gray",
            marginBottom: "20px",
          }}
        ></div>
      </div>
    </div>
  );
};

export default Faq;
